import { useNavigate } from "react-router-dom";

export default function PlanTravel() {
  const nav = useNavigate();

  return (
    <div className="dark-container">
      <h2>Plan Your Travel</h2>

      <input placeholder="Starting Location" />
      <input placeholder="Search Radius (km)" />
      <input placeholder="Budget" />
      <input placeholder="Currency" />
      <input placeholder="Trip Duration" />

      <select>
        <option>Family</option>
        <option>Friends</option>
        <option>Couple</option>
        <option>Solo</option>
      </select>

      <button className="primary-btn" onClick={() => nav("/map")}>
        Show Map
      </button>
    </div>
  );
}
